import React from "react";

const date = new Date();
const Time = new Date();

const App = (props) => {
return(
<>

<h1>Todays Date is : {date.toLocaleDateString()}</h1>
<h1>These is the Title {props.title} </h1>

<h1>Todays Time is : {Time.toLocaleTimeString()}</h1>


</>
)


}
export default App;
